import React from "react";
import Overview from "./Overview";

export default function Search() {
  return (
    <div id="searchForm">
      <form>
        <input type="text" defaultValue="search for a topic"></input>
        <button type="submit">Submit</button>
      </form>
      <Overview />
    </div>
  );
}
